   "source": [
    "# **Cleaning the dataset**\n",
    "Every entry has a list of Genres and Production Countries in the format `['entry1','entry2']`. This is converted to `entry1, entry2...` format"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 3,
   "id": "0d45c8d2",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2022-06-30T08:05:36.413328Z",
     "iopub.status.busy": "2022-06-30T08:05:36.411553Z",
     "iopub.status.idle": "2022-06-30T08:05:36.479467Z",
     "shell.execute_reply": "2022-06-30T08:05:36.477504Z"
    },
    "papermill": {
     "duration": 0.080204,
     "end_time": "2022-06-30T08:05:36.482954",
     "exception": false,
     "start_time": "2022-06-30T08:05:36.402750",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "# Cleaning\n",
    "netflix <- netflix %>%\n",
    "      mutate(genres = na_if(genres, \"[]\"), production_countries = na_if(production_countries, \"[]\"))\n",
    "\n",
    "netflix$genres <- gsub(\"\\\\[|\\\\]|\\\\'|\\\\s\", \"\", as.character(netflix$genres))\n",
    "netflix$production_countries <- gsub(\"\\\\[|\\\\]|\\\\'|\\\\s\", \"\", as.character(netflix$production_countries))\n",
    "\n",
    "netflix$type <- gsub(\"MOVIE\", \"Movie\", as.character(netflix$type))\n",
    "netflix$type <- gsub(\"SHOW\", \"TV Show\", as.character(netflix$type))"
   ]
  },
