    "# Cleaning Genres\n",
    "netflix_genre <- netflix %>% \n",
    "    separate_rows(genres, sep=\",\") %>%\n",
    "    pivot_wider(names_from = genres, values_from = genres, values_fn = function(x) 1, values_fill = 0) \n",
    "netflix_genre <- select(netflix_genre, -'NA')"
   ]
  },
